import React, { useState, useEffect } from "react";

const Commits = ({ url, getReady, getReady2 }) => {
    const [commits, setCommits] = useState('')

    useEffect(() => {
        (async() => {
            const result = await fetch(url)
	        const repos = await result.json()

            setCommits(repos)
        })()
    }, [url])

    return(
        <div>
            <h3>Los commits son:</h3>
            {commits.length > 0 ? 
            (<div >
                {commits.map((commit, index) => {
                    return (
                    <div key = { index }>
                        <h4>{commit.commit.message}</h4>
                    </div> )})}
                    <button onClick= { getReady2(commits[0].url.replace('commits', 'git/trees') + "?recursive=1") } >See commits!</button>
            </div> 

            )
            :
            <p>El usuario no tiene repositorios</p>
            }
            <button onClick = { getReady("", true)}>Back</button>
        </div>
    )
}


export default Commits
